By default, variables are immutable. Error: fn main() { let x = 5; println!("The value of x is: {}", x); x = 6;
} Make it mutable by adding mut in front of the variable name: fn main() { let mut x = 5; println!("The value of x is: {}", x); x = 6; println!("The value of x is: {}", x);
}

